.mine {
  position: relative;
  flex-direction: column;
  width: 100%;
  height: 100%;

  :deep(.dialog-msg) {
    width: 708px;
    height: auto;
    padding: 40px;

    .van-dialog__header {
      padding: 0;
      font-size: 29px;
      color: #13161b;
      font-weight: normal;
    }

    .van-dialog__content {
      margin: 33px 0 35px 0;
      font-size: 25px;
      color: #787f8c;
      text-align: justify;
    }

    .van-dialog__footer {
      padding: 0;
    }

    .van-dialog__confirm,
    .btn-confirm {
      width: 100%;
      height: 80px;
      font-size: 31px;
      background: var(--van-button-primary-background);
      color: #fff;
      border: 0;
      border-radius: 8px;
    }

    .icon-close {
      position: absolute;
      right: 40px;
      top: 24px;
    }

    .add-time {
      margin-bottom: 25px;
    }

    .content {
      color: #13161b;
    }

    img {
      width: 100%;
      margin-top: 20px;
    }
  }

  .mine-top {
    height: calc(constant(safe-area-inset-top) + 100px);
    height: calc(env(safe-area-inset-top) + 100px);
  }
}

